import React, { useEffect } from "react";

import {APIProvider, Map} from '@vis.gl/react-google-maps'


export const Google_Map = () => {

    let Current_Lat=53.54992;
    let Current_Lng=10.00678

    const initGeolocation = () =>{
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function(position) {
            const Current_Location_Data =  position.toJSON()
            Current_Lat = Current_Location_Data.coords.latitude;
            Current_Lng = Current_Location_Data.coords.longitude;
        },()=>{});
      } }

      useEffect(()=>{
        initGeolocation()
      },[])

return <React.Fragment>

            <APIProvider apiKey={`${process.env.REACT_APP_API}`}>

                <Map
                
                    style={ 
                        { width:'inherit',
                        height:'20vh',
                        backgroundColor:'white',
                        margin: '3vh 6vw 0 10vw',
                        border: 'black solid 5px'
                        }}
                    
                    zoom={15}

                    center={{lat: Current_Lat, lng: Current_Lng}} />

            </APIProvider>


</React.Fragment>

}

export default Google_Map
